#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#define MOD 1000000007

int countSubMultisets(int* nums, int numsSize, int l, int r) {
    int maxSum = 0;
    for (int i = 0; i < numsSize; ++i) {
        maxSum += nums[i];
    }
    maxSum = maxSum > r ? r : maxSum;

    // dp[i] represents the count of sub-multisets with sum equals to i
    int* dp = (int*)calloc(maxSum + 1, sizeof(int));
    dp[0] = 1; // empty set

    for (int i = 0; i < numsSize; ++i) {
        for (int sum = maxSum; sum >= nums[i]; --sum) {
            dp[sum] = (dp[sum] + dp[sum - nums[i]]) % MOD;
        }
    }

    int count = 0;
    for (int sum = l; sum <= r; ++sum) {
        count = (count + dp[sum]) % MOD;
    }

    free(dp);
    return count;
}
